import Aside from "../components/Aside";
import RegisterCode from "../components/RegisterCode";
import "./css/safekids.css";

const Safekids = () => {
  return (
    <main className="safekids">
      <Aside atual="safekids" />
        <section className="dashboard">
            <h1>SafeKids</h1>
            <RegisterCode />
        </section>

    </main>
  );
};

export default Safekids;
